script: |
  super -f text -I q9665.spq | sort > q9665.out

inputs:
  - name: q9665.spq
    data: |
      SELECT DISTINCT + col0 AS col0 FROM tab0 (FORMAT parquet) WHERE - + 23 NOT IN ( 29, col2 / col2 / + col2 + - col0, 99 * - 20 );
  - name: tab0

outputs:
  - name: q9665.out
    data: |
      15
      87
      97
